function Instructions() {
    return (
        <div className = "instructions" style = {insStyle}>
            <h3>Instructions</h3>
            <p>Click on images to earn points,</p><br></br><p>don't click on any twice!</p>
        </div>
    )
}

const insStyle = {
    border: "1px solid black",
    width: "fit-content",
    lineHeight: "10px",
    padding: "5px",
    marginLeft: "5px"
}

export default Instructions;
